CREATE TABLE indiewise_db.Nomination
(
    id char(36) PRIMARY KEY NOT NULL,
    awardPntr char(36),
    createdAt datetime,
    critique char(36),
    updatedAt datetime,
    project char(36),
    nominator char(36),
    CONSTRAINT award_awardpntr_bkname_nomination_awardPntr FOREIGN KEY (awardPntr) REFERENCES Award (id) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT critique_critique_bkname_nomination_critique FOREIGN KEY (critique) REFERENCES Critique (id) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT project_project_bkname_nominations FOREIGN KEY (project) REFERENCES Project (id) ON DELETE CASCADE ON UPDATE CASCADE,
    CONSTRAINT users_nominator_bkname_nominations FOREIGN KEY (nominator) REFERENCES users (id) ON DELETE CASCADE ON UPDATE CASCADE
);
CREATE INDEX award_awardpntr_bkname_nomination_awardPntr ON indiewise_db.Nomination (awardPntr);
CREATE INDEX critique_critique_bkname_nomination_critique ON indiewise_db.Nomination (critique);
CREATE UNIQUE INDEX nomination_id_unique ON indiewise_db.Nomination (id);
CREATE INDEX project_project_bkname_nominations ON indiewise_db.Nomination (project);
CREATE INDEX users_nominator_bkname_nominations ON indiewise_db.Nomination (nominator);
